import React from 'react'
import Note from './Note'

function NotesList({ notes }) {
  return (
    <>
        <div className='notes-list'>
            {notes.map((note) =>(
                <Note id={note.id} text={note.text}/> 
            ))}
        </div>
    </>
  )
}

export default NotesList
